--NOTICE
CREATE TABLE "TEST7"."NOTICE" 
       (	 "NOTI_IDX" NUMBER(20,0), 
             "NOTI_TITLE" VARCHAR2(100 BYTE) NOT NULL, 
             "NOTI_CONTENT" VARCHAR2(1000 BYTE) NOT NULL, 
             "NOTI_AUTHOR" VARCHAR2(20 BYTE), 
             "NOTI_FILE" VARCHAR2(200 BYTE), 
             "NOTI_REGDATE" DATE DEFAULT current_timestamp,
             PRIMARY KEY ("NOTI_IDX"),
             CONSTRAINT noti_author_fk foreign key(noti_author) REFERENCES user_tbl(user_id) ON DELETE CASCADE)
;

CREATE SEQUENCE NOTI_SEQ START WITH 1 INCREMENT BY 1 NOCYCLE;

    
    
--/NOTICE    
---------------------------------------------------------------------------------------------
--QNA
CREATE TABLE "TEST7"."QNA" 
       (	 "QNA_IDX" NUMBER(20,0), 
             "QNA_TITLE" VARCHAR2(100 BYTE) NOT NULL, 
             "QNA_CONTENT" VARCHAR2(1000 BYTE) NOT NULL, 
             "QNA_ID" VARCHAR2(20 BYTE), 
             "QNA_RESDATE" DATE DEFAULT current_timestamp, 
             "LEV" NUMBER(5,0), 
             "PARNO" NUMBER(20,0), 
             "REPLY_CNT" NUMBER(5,0) DEFAULT 0,
             PRIMARY KEY ("QNA_IDX"),
             CONSTRAINT qna_id_fk foreign key(qna_id) REFERENCES user_tbl(user_id) ON DELETE CASCADE)
;
    
CREATE SEQUENCE QNA_SEQ START WITH 1 INCREMENT BY 1 NOCYCLE;    


    
    
--/QNA    
