--REVIEW
CREATE TABLE review (rev_idx NUMBER(20) NOT NULL,   -- 리뷰 idx
                     rs_idx NUMBER, --레스토랑 idx,
                     rev_title VARCHAR2(100) NOT NULL,  --제목
                     rev_score NUMBER(1),   --평점 1~5
                     rev_id VARCHAR2(20),   --리뷰자id
                     rev_file VARCHAR2(200),    --첨부파일
                     rev_content VARCHAR2(1000),      --리뷰
                     rev_regdate date DEFAULT current_timestamp,    --작성일
                     PRIMARY KEY (rev_idx),
                     CONSTRAINT "REVIEW_IDX_FK" FOREIGN KEY ("RS_IDX") REFERENCES "TEST7"."RESTAURANT" ("RS_IDX") ON DELETE CASCADE,
                     CONSTRAINT "REVIEW_USER_FK" FOREIGN KEY ("REV_ID") REFERENCES "TEST7"."USER_TBL" ("USER_ID") ON DELETE CASCADE)
;
    
CREATE SEQUENCE REV_SEQ START WITH 1013 INCREMENT BY 1 NOCYCLE;


