Insert into TEST7.RESTAURANT (RS_IDX,RS_FOOD_CATE,RS_NAME,RS_PHONE,RS_REGION_CATE,RS_ADDR,RS_FILE,RS_CONTENT) values (REST_SEQ.nextval,'01','스카이 온 파이브 다이닝','064-908-1200','01','제주특별자치도 서귀포시 안덕면 신화역사로304번길 38 메리어트관 제주신화월드 호텔앤리조트 5층','seoguipo01.jpg','셰프가 엄선한 신선한 식재료로 준비한 다채로운 메뉴를 즐겨 보자. 한식부터 일식, 중식, 양식은 물론 제주 특산물을 사용한 스페셜 메뉴까지 환상적인 뷰와 함께 품격 있는 뷔페이다.');
