Insert into TEST7.RESTAURANT (RS_IDX,RS_FOOD_CATE,RS_NAME,RS_PHONE,RS_REGION_CATE,RS_ADDR,RS_FILE,RS_CONTENT) values (REST_SEQ.nextval,'01','스시호시카이','064-713-8838','02','제주특별자치도 제주시 오남로 90','jeju03.jpg','''초밥(스시)''과 ''별(호시)'', 그리고 ''바다(카이)''를 상호로 쓰고 있는 스시호시카이는 별이 빛나는 제주 바다에서 자라난 해산물로 만든 스시를 선보이는 집이다.');
Insert into TEST7.RESTAURANT (RS_IDX,RS_FOOD_CATE,RS_NAME,RS_PHONE,RS_REGION_CATE,RS_ADDR,RS_FILE,RS_CONTENT) values (REST_SEQ.nextval,'02','젠하이드어웨이','064-794-0133','01','제주특별자치도 서귀포시 안덕면 사계남로 186-8','scafe03.jpg','산방산과 바다가 어우러진 멋진 풍경을 감상할 수 있는 레스토랑이다. 통창과으로 보이는 바다 풍경이 가슴속까지 시원하다. 드넓은 테라스에서는 눈에 걸리는 것 하나 없는 제주의 바다를 만끽할 수 있다.');
Insert into TEST7.RESTAURANT (RS_IDX,RS_FOOD_CATE,RS_NAME,RS_PHONE,RS_REGION_CATE,RS_ADDR,RS_FILE,RS_CONTENT) values (REST_SEQ.nextval,'02','에스프레소 라운지','064-712-5151','02','제주특별자치도 제주시 한라대학로 1 (노형동)','jcafe03.jpg','제주공항근처 한라대사거리에 위치해서 공항가기 전후로 잠깐들러 휴식을 취하기 좋은 곳이다.');
