Insert into TEST7.RESTAURANT (RS_IDX,RS_FOOD_CATE,RS_NAME,RS_PHONE,RS_REGION_CATE,RS_ADDR,RS_FILE,RS_CONTENT) values (REST_SEQ.nextval,'01','돈사돈','064-746-8989','02','제주특별자치도 제주시 우평로 19','jeju01.jpg','2006년 영업을 시작한 제주의 근고기 구이 전문점으로, 평일 낮 시간에도 북적거릴 정도로 인기가 좋다. 현장에서 기다리시는 손님들을 위해 예약은 받지 않는 것이 원칙이다.');
Insert into TEST7.RESTAURANT (RS_IDX,RS_FOOD_CATE,RS_NAME,RS_PHONE,RS_REGION_CATE,RS_ADDR,RS_FILE,RS_CONTENT) values (REST_SEQ.nextval,'01','순옥이네 명가','064-743-4813','02','제주 제주시 도공로 8','jeju02.jpg','순옥이네 명가는 15년 째 성업 중인 전복물회의 명가다. 해녀가 운영하는 검증된 식당인 데다가 물회는 물론 성게미역국, 해물뚝배기 등 해물의 묵직하면서도 개운한 맛을 찾는 이들로 늘 북적인다. 직접 따온 전복, 성게, 오분작 등의 자연산 해산물요리를 제공한다. ');
