Insert into TEST7.RESTAURANT (RS_IDX,RS_FOOD_CATE,RS_NAME,RS_PHONE,RS_REGION_CATE,RS_ADDR,RS_FILE,RS_CONTENT) values (REST_SEQ.nextval,'02','와토커피','010-8324-1455','01','제주특별자치도 서귀포시 대정읍 동일하모로 238','scafe02.jpg','모던하고 깔끔하며 아기자기한 인테리어는 센스 있는 젊은 남자 사장님이 손수 가꾸고 꾸민 흔적이다.');
Insert into TEST7.RESTAURANT (RS_IDX,RS_FOOD_CATE,RS_NAME,RS_PHONE,RS_REGION_CATE,RS_ADDR,RS_FILE,RS_CONTENT) values (REST_SEQ.nextval,'01','고래라면','064-782-6685','01','제주특별자치도 서귀포시 성산읍 삼달로 104','seoguipo01.jpg','김영갑갤러리 근처에 위치한 아담한 규모의 식당으로, 라면과 국수 종류를 전문으로 판매한다. 외관과 내부가 심플하고 소박한 분위기를 가지고 있다. 고래라면의 대표 메뉴는 오동통하고 싱싱한 문어가 들어가 있는 문어라면이다.');
